import React from 'react';
import { Route, Routes } from 'react-router-dom';

const SliderBtn = () => {
    return (
        <div>
            <Routes>

                <Route path="/" element={<Main />} />
            </Routes>
        </div>
    );
};

export default SliderBtn;
